import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import Routes from './routes'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Link to="/comments"></Link>
       <Routes />
      </div>
    );
  }
}

export default App;
